import React, {useState} from "react"
import './App.css';
//Import Components
import Form from "./components/Form"
import TodoList from "./components/TodoList";

function App() {
  const [inputText, setInputText] = useState("");
  const [todo, setTodo] = useState([]);
  return (
    <div className="App">
      <Form 
        inputText={inputText}
        todo={todo} 
        setTodo={setTodo}
        setInputText={setInputText}
      />
      <TodoList />
    </div>
  );
}

export default App;
